import React from "react";

const WeekFive = () => {
  return (
    <div className="week week-5">
      <div className="day sunday">
        <span className="number">26</span>
        <span className="large-letter">Q</span>
      </div>
      <div className="day monday">
        <span className="number">27</span>
      </div>
      <div className="day tuesday">
        <span className="number">28</span>
      </div>
      <div className="day wednesday">
        <span className="number">29</span>
      </div>
      <div className="day thursday">
        <span className="number">30</span>
      </div>
      <div className="day friday"></div>
      <div className="day saturday"></div>
    </div>
  );
};

export default WeekFive;
